async def send_requests(url, num_requests, interval):
    async with httpx.AsyncClient() as client:
        request_count = 0
        while True:
            for _ in range(num_requests):
                try:
                    # Select a random user agent
                    user_agent = random.choice(USER_AGENTS)
                    headers = {"User-Agent": user_agent}
                    await client.get(url, headers=headers)
                    request_count += 1
                    print(f'{request_count} request(s) sent')
                except httpx.HTTPError as e:
                    print(f'HTTP error occurred: {e}')
                    break  # Break out of the inner loop and restart the entire loop
                except Exception as e:
                    print(f'An error occurred: {e}')
                    break  # Break out of the inner loop and restart the entire loop
                await asyncio.sleep(interval)

url = input("Enter the URL: ")
num_requests = int(input("Enter the number of requests: "))
interval = float(input("Enter the interval between requests (in seconds): "))

asyncio.run(send_requests(url, num_requests, interval))

